      const initialNavigationKey = Object.keys(chains)[0];
      const initialNavChildren = chains[initialNavigationKey].children;
      if (initialNavChildren && Object.keys(initialNavChildren).length > 0) {
        walk(initialNavChildren, 0);
      }

